  [],\n\t\"revision_timestamp\": \"2016-10-15T16:36:13.197865\",\n\t\"name\": \"parker-river-national-wildlife-refuge-narrative-report-jan-dec-1972\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Parker
  River NWR outlines Refuge accomplishments during the 1972 calendar year. The report
  begins by summarizing the weather conditions, habitat conditions, water conditions,
  and food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and vegetation control. Resource management is
  outlined; topics include haying. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, violations, and
  safety. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
